INSERT INTO [Locations] ([Id], [Name], [Location], [MaxVisitors], [Description]) VALUES ('01c669-89dd-478b-aee0-d10a1b5e4e', 'Lakeside Pavilion', 'Schwerin Lake', 50, 'Enjoy panoramic views of Schwerin Lake from this charming lakeside pavilion. Surrounded by nature, it offers a peaceful setting for small events, such as weddings and family gatherings.');
