INSERT INTO [Locations] ([Id], [Name], [Location], [MaxVisitors], [Description]) VALUES ('0c25a4-a61f-4d6d-bd9c-55aebcfd00', 'Town Hall Courtyard', 'Neustrelitz', 120, 'Located in the heart of Neustrelitz, the town hall courtyard offers a historic backdrop for small events. With its elegant architecture and central location, it''s an ideal venue for cultural festivities and community gatherings.');
