INSERT INTO [Locations] ([Id], [Name], [Location], [MaxVisitors], [Description]) VALUES ('7450d8-fb49-4661-9642-ad5597ee40', 'Riverside Cabin', 'Peene Valley', 30, 'Located along the banks of the Peene River, this cozy cabin provides an intimate setting for small events. Guests can enjoy fishing, kayaking, and serene views of the river.');
